// App.js
import React from 'react';
import Card from './Components/Card';
import './App.css';

const App = () => {
  const handleButtonClick = () => {
    alert('Saved!');
  };

  return (
    <div className="app">
      <Card
        title="Spring Flowers"
        description="Walking through sprawling fields of blooming flowers is the perfect way to celebrate Spring. "
        imageUrl="https://images.unsplash.com/photo-1559150182-a7144f7628f9?q=80&w=2008&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
        buttonText="Save"
        onButtonClick={handleButtonClick}
      />
      <Card />
    </div>
  ); 
};

export default App;
